(1855, 'Qaisar Gilani', 'male', '', '1990-05-14', '3630265712715', '', 'Makhdoom House multan cantt', 'Multan', 'gilaniqaiser2002@yah', '3236142113', 'Barrister/Lawyer ', 'Self Employed', 'Qaisar Gilani Law Chambers', '650000', '', '', '', '', 'As of now i donâ€™t have a business interest even though i have few real estate investments in place in Gawadar but mostly my interest is due to its coastal beauty. I plan to have a vacation home  on the coast so i can spend my time and host my guests especially from overseas. I spend most of my time in London and NewYork i have guests visiting Pakistan all the time and i would love to host them in this city.', 'no', NULL, '2024-04-05', '', ''),
(1856, 'Naqash Ahmad ', 'male', '', '2000-02-15', '3510404222261', '', 'Lahore DHA Phase five ', 'Lahore Pakistan ', 'ayatnazir33@gamil.co', '03004347723', 'Business Advisor consulated an', 'Own business ', 'Jubil industry Saudia Arab ', '9400000', 'No', 'No', 'No', 'No', 'The China-Pakistan Economic Corridor (CPEC) seeks to develop Pakistanâ€™s industrial capacity and contribute to its emergence as a trading hub between China and the Middle East in the long run. The deep-sea seaport of Gwadar in the Arabian Sea will play an instrumental role in this respect due to its proximity with the strategic sea-lanes for global energy trade in the Persian Gulf. This article offers a critical analysis of CPECâ€™s strategic value for Pakistanâ€™s economic development and regional connectivity, especially Gwadarâ€™s valuable role in this\r\nregard. It challenges the prevailing zero-sum narratives on the geopoliticsp of this strategic port within the context of US-China rivalry, while arguing for its geo-economic importance  for China, Central Asia, Pakistan and the Gulf states on the basis of a win-win framework. The discussion ahead covers the key challenges and opportunities concerning CPEC, Chinaâ€™s economic profile in Central Asia and the Gulf, and the emerging interest among the Gulf countries for investment in Gwadar. The concluding section focuses on CPECâ€™s significance for China, Pakistan and regional stakeholders and Gwadarâ€™s future potential as a regional trading hub and a possible strategic outpost for China.', 'no', NULL, '2024-04-05', '', ''),
